import React, {useState} from 'react';
import Information from '../components/Information'
import Content from '../components/Content'
import workExamples from "../workExamples"
import Rugby from "../Rugby"
import AFL from "../AFL"
import CK from "../CK"
import Ty from "../Ty"
import OGI from "../OGI"


const Home = (props) => {
    // const [selectedTitle, newTitle] = useState(value);
    // var value = [0, 1, 2, 3, 4];

    // function changeTitle(event)
    // {
    //     const newValue = event.target.value;
    //     newTitle(newValue);
    // }
    
    return (
        <div>
            <Information 
                title = {workExamples[selectedTitle].title}
                position={workExamples[selectedTitle].position}
                description={workExamples[selectedTitle].description}
                platform1={workExamples[selectedTitle].platform1}
                platform2={workExamples[selectedTitle].platform2}
                platform3={workExamples[selectedTitle].platform3}
                platform4={workExamples[selectedTitle].platform4}
                platform5={workExamples[selectedTitle].platform5}
            />
            <div className = "Container">
                <div className="dictionary" onMouseOver={changeTitle} value="0">
                {Rugby.map((props) => (
                    <Content
                        images={props.id}
                    />
                ))}
                </div>

                <div className="dictionary"  onMouseOver={changeTitle} value="1">
                {AFL.map((props) => (
                    <Content
                        images={props.id}
                    />
                ))}
                </div>

                <div className="dictionary"  onMouseOver={changeTitle} value="2">
                {Ty.map((props) => (
                    <Content
                        images={props.id}
                    />
                ))}
                </div>

                <div className="dictionary"  onMouseOver={changeTitle} value="3">
                {CK.map((props) => (
                    <Content
                        images={props.id}
                    />
                ))}
                </div>

                <div className="dictionary"  onMouseOver={changeTitle} value="4">
                {OGI.map((props) => (
                    <Content
                        images={props.id}
                    />
                ))}
                </div>
            </div>
        </div>
    )
}

export default Home;
